import axiosInstance from '../core/axiosInstance';

export const getAllZimmet = () => {
  return axiosInstance.get("/zimmet/zimmetler");
};


export const addZimmetItem = (zimmetData) => {
    return axiosInstance.post('/zimmet/create', zimmetData);
};
